import React from 'react'
import { Card } from 'antd'

const PostCard = ({ post }) => {
  return (
    <div>
      <Card
        cover={post.Images[0] && <PostImages />}
      >
        <Image />
        <Content />
        <Buttons></Buttons>
      </Card>
      <CommentForm />
      <Comments />
    </div>
  )
}

PostCard.propTypes = {
  post: PropTypes.string.isRequired
}
export default PostCard
